import React from 'react';

const OGMarketplaceCard = ({ listing, purchaseOrdinal }) => {
    if (!listing || listing.length === 0) {
        return <div>No listing available</div>;
    }

    return (
        <div className="marketplace-container">
            {listing.map((listing, index) => (
                <div key={index} className="listing-card rounded-lg overflow-hidden m-4 p-4 bg-white border-4 border-black shadow-xl">
                    <div className="px-6 py-4">
                        <div className="font-bold text-lg mb-2">Listing: {listing.name}</div>
                        <div>Description: {listing.description}</div>
                        <div>Price: {listing.price}</div>
                        {/* Additional listing details here */}
                    </div>
                    <button
                        onClick={() => buyFunction(listing)}
                        className="buy-btn border-0 text-md bg-blue-500 hover:bg-green-700 hover:text-white border-black rounded-xl p-4">
                        Buy
                    </button>
                </div>
            ))}
        </div>
    );
};

export default OGMarketplaceCard;
